import React from 'react';


function BookTable() {
  const [date, setDate] = React.useState();
  const [time, setTime] = React.useState();
  const [seatingNo, setSeatingNo] = React.useState();

    return (
      <div>
          <h2>Book Table</h2>

          <form onSubmit={handleSubmit}>
            <label>
              Select a date:
              <input type="text" value={date} onChange={(event) => {setDate(event.target.value)}}/>
            </label>
            <label>
              Select a time:
              <input type="text" value={time} onChange={(event) => {setTime(event.target.value)}} />
            </label>
            <label>
              Select your seating number:
              <input type="text" value={seatingNo} onChange={(event) => {setSeatingNo(event.target.value)}} />
            </label>

            <input type="submit" value="BOOK" />
        </form>


      </div>
    ); 

  }

  function handleSubmit() {
    console.log('BOOKED!')
  }

